import Planeswalk from "./img/symbols/PW.png";
import Chaos from "./img/symbols/CHAOS.png";
import Blank from "./img/symbols/BLANK.png";

export const dieOptions = [
  {
    name: 'Blank',
    image: Blank,
  },
  {
    name: 'Blank',
    image: Blank,
  },
  {
    name: 'Blank',
    image: Blank,
  },
  {
    name: 'Blank',
    image: Blank,
  },
  {
    name: 'Planeswalk',
    image: Planeswalk,
  },
  {
    name: 'Chaos',
    image: Chaos,
  },
];
